import React from "react";
import { MapContainer, TileLayer, Marker } from "react-leaflet";

function MapPage() {
  return (
    <div id="map" style={{ height: "400px" }}>
      <MapContainer
        center={[51.505, -0.09]} // Coordenadas para o centro do mapa
        zoom={13} // Zoom inicial do mapa
        style={{ height: "100%", width: "100%" }}
      >
        <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" /> {/* Fornecedora de tiles do mapa */}
        <Marker position={[51.505, -0.09]} /> {/* Marcador no mapa */}
      </MapContainer>
    </div>
  );
}

export default MapPage;
